import logo from './logo.svg';
import './App.css';
import Header from "./components/header";
import Footer from "./components/footer";
import {Container} from "react-bootstrap";

function App() {
  return (
    <div className="App">
<Container>
    <Header />
    <main className="py-3">
        <h1>Welcome to Second Sale</h1>
    </main>
    <Footer/>
</Container>
    </div>
  );
}

export default App;
